import React from 'react';
import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';

import LoginU from './pages/loginPage'

function App() {
  return (
    <BrowserRouter>
      <Routes>

        {/* user login and registration */}
        <Route path="/user/login" element={<LoginU/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
